#!/usr/bin/env python3
import sys

YES = "Yes"  # type: str
NO = "No"  # type: str


def solve(c: "List[List[int]]"):
    if not c[0][0] - c[0][1] == c[1][0] - c[1][1] == c[2][0] - c[2][1]:
        print(NO)
        return
    if not c[0][1] - c[0][2] == c[1][1] - c[1][2] == c[2][1] - c[2][2]:
        print(NO)
        return
    if not c[0][0] - c[1][0] == c[0][1] - c[1][1] == c[0][2] - c[1][2]:
        print(NO)
        return
    if not c[1][0] - c[2][0] == c[1][1] - c[2][1] == c[1][2] - c[2][2]:
        print(NO)
        return
    print(YES)
    return


# Generated by 2.6.0 https://github.com/kyuridenamida/atcoder-tools  (tips: You use the default template now. You can remove this line by using your custom template)
def main():
    def iterate_tokens():
        for line in sys.stdin:
            for word in line.split():
                yield word
    tokens = iterate_tokens()
    c = [[int(next(tokens)) for _ in range(3)] for _ in range(3)]  # type: "List[List[int]]"
    solve(c)

if __name__ == '__main__':
    main()
